// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";

contract BLEUFINFT is ERC721Enumerable, Ownable, EIP712 {
    struct Fee {
        address payable recipient;
        uint256 value;
    }

    mapping(uint256 => bool) public mintedNonce;

    uint256 public nonceCount;

    uint256 private tokenCount;

    // tokenId => royality percetage
    mapping(uint256 => uint256) public royalities;

    // tokenId => Creator
    mapping(uint256 => address payable) public creators;

    // address => tokens created
    mapping(address => uint256[]) public tokensPerCreator;
    using Strings for uint256;

    // Optional mapping for token URIs
    mapping(uint256 => string) private _tokenURIs;

    string private constant SIGNING_DOMAIN = "LazyNFT-Voucher";
    string private constant SIGNATURE_VERSION = "1";

    uint256 public maximumRoyality;

    mapping(address => uint256) pendingWithdrawalsCreator;

    constructor()
        ERC721("BLEUFI NFT", "BLEUFINFT")
        EIP712(SIGNING_DOMAIN, SIGNATURE_VERSION)
    {
        setmaximumRoyality(1000);
    }

    // Structure to hold NftVoucher details
    struct NftVoucher {
        uint256 vNonce;
        uint256 minPrice;
        string tokenUri;
        bytes signature;
        uint256 royality;
    }

    /**
     * @dev This function will set maxRoyaltiy , access type is onlyOwner
     * @notice This Function will set maxRoyaltiy, minter should input royality under maxRoyaltiy
     * @param _maxroyality Uint input value.
     */
    function setmaximumRoyality(uint256 _maxroyality) public onlyOwner {
        maximumRoyality = _maxroyality;
    }

    /**
     * @dev This function will use to mint NFT which have NFT voaucher and signature genrated from frontend
     * @notice This function will use to mint NFT /
       which is created from frontend the redeemer redem this NFT by passing the required agrs.
     * @param creator address of  voucher creator.
     * @param voucher enter the voucher  as tuple [id,price,uri,signature,royality]. 
     */
    function LazyMint(address payable creator, NftVoucher calldata voucher)
        public
        payable
        returns (uint256)
    {
        require(
            mintedNonce[voucher.vNonce] == false,
            "This nonce already done"
        );
        // make sure signature is valid and get the address of the signer
        bytes32 messageHash = getMessageHash(
            voucher.vNonce,
            voucher.minPrice,
            voucher.tokenUri
        );

        bytes32 ethSignedMessageHash = getEthSignedMessageHash(messageHash);

        address signer = recoverSigner(ethSignedMessageHash, voucher.signature);
        tokenCount = tokenCount + 1;
        creators[tokenCount] = creator;

        // make sure that the signer is authorized to mint NFTs
        require(creator == signer, "Signature invalid or unauthorized");

        // make sure that the redeemer is paying enough to cover the buyer's cost
        require(msg.value >= voucher.minPrice, "Insufficient funds to redeem");
        require(
            voucher.royality <= maximumRoyality,
            "royality of creater is too high"
        );

        // first assign the token to the signer, to establish provenance on-chain

        _safeMint(signer, tokenCount);

        royalities[tokenCount] = voucher.royality;
        _setTokenURI(tokenCount, voucher.tokenUri);
        // transfer the token to the redeemer
        _transfer(signer, msg.sender, tokenCount);
        creator.transfer(msg.value);
        mintedNonce[voucher.vNonce] = true;
        nonceCount = nonceCount + 1;
        // record payment to signer's withdrawal balance
        // pendingWithdrawalsCreator[signer] += msg.value;

        return tokenCount;
    }

    /**
     * @dev This function will use to Buy NFT / 
       which have NFT voaucher and signature genrated from frontend by seller
     * @notice This function will use to Buy NFT /
       which is created from frontend the buyer buy this NFT by passing the required agrs.
     * @param seller address of  voucher seller.
     * @param voucher enter the voucher  as tuple [id,price,uri,signature,royality]. 
     */

    /// @notice Returns the chain id of the current blockchain.
    /// @dev This is used to workaround an issue with ganache returning different values from the on-chain chainid() function and
    ///  the eth_chainId RPC method. See https://github.com/protocol/nft-website/issues/121 for context.
    function getChainID() external view returns (uint256) {
        uint256 id;
        assembly {
            id := chainid()
        }
        return id;
    }

    function getMessageHash(
        uint256 _nonce,
        uint256 minPrice,
        string memory tokenUri
    ) public pure returns (bytes32) {
        return keccak256(abi.encodePacked(_nonce, minPrice, tokenUri));
    }

    function getEthSignedMessageHash(bytes32 _messageHash)
        public
        pure
        returns (bytes32)
    {
        /*
        Signature is produced by signing a keccak256 hash with the following format:
        "\x19Ethereum Signed Message\n" + len(msg) + msg
        */
        return
            keccak256(
                abi.encodePacked(
                    "\x19Ethereum Signed Message:\n32",
                    _messageHash
                )
            );
    }

    function recoverSigner(
        bytes32 _ethSignedMessageHash,
        bytes memory _signature
    ) public pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);

        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function splitSignature(bytes memory sig)
        internal
        pure
        returns (
            bytes32 r,
            bytes32 s,
            uint8 v
        )
    {
        require(sig.length == 65, "invalid signature length");

        assembly {
            /*
            First 32 bytes stores the length of the signature

            add(sig, 32) = pointer of sig + 32
            effectively, skips first 32 bytes of signature

            mload(p) loads next 32 bytes starting at the memory address p into memory
            */

            // first 32 bytes, after the length prefix
            r := mload(add(sig, 32))
            // second 32 bytes
            s := mload(add(sig, 64))
            // final byte (first byte of the next 32 bytes)
            v := byte(0, mload(add(sig, 96)))
        }

        // implicitly return (r, s, v)
    }

    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        require(
            _exists(tokenId),
            "ERC721URIStorage: URI query for nonexistent token"
        );

        string memory _tokenURI = _tokenURIs[tokenId];
        string memory base = _baseURI();

        // If there is no base URI, return the token URI.
        if (bytes(base).length == 0) {
            return _tokenURI;
        }
        // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
        if (bytes(_tokenURI).length > 0) {
            return string(abi.encodePacked(base, _tokenURI));
        }

        return super.tokenURI(tokenId);
    }

    /**
     * @dev Sets `_tokenURI` as the tokenURI of `tokenId`.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function _setTokenURI(uint256 tokenId, string memory _tokenURI)
        internal
        virtual
    {
        require(
            _exists(tokenId),
            "ERC721URIStorage: URI set of nonexistent token"
        );
        _tokenURIs[tokenId] = _tokenURI;
    }

    /**
     * @dev Destroys `tokenId`.
     * The approval is cleared when the token is burned.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     *
     * Emits a {Transfer} event.
     */
    function _burn(uint256 tokenId) internal virtual override {
        super._burn(tokenId);

        if (bytes(_tokenURIs[tokenId]).length != 0) {
            delete _tokenURIs[tokenId];
        }
    }

    function burn(uint256 tokenId) public {
        require(ownerOf(tokenId) == msg.sender, "caller is not token owner");
        _burn(tokenId);
    }

    /**
     * @dev This function will use mint normal NFTs
     * @notice This function will use mint normal NFTs /
        Minter mint  this NFT by passing the required agrs.
     * @param _id  tokenId
     * @param _to reciver address. 
     * @param _royality creater royality. 
     * @param _tokenURI  token URI. 
     */
    function mint(
        uint256 _id,
        address _to,
        uint256 _royality,
        string memory _tokenURI
    ) public {
        require(
            _royality <= maximumRoyality,
            "royality of creater is too high"
        );
        mint_(_to, _id, _royality);

        _setTokenURI(_id, _tokenURI);
    }

    /**
        * @dev This function will use mint multiple NFTs , only owner can call this function
        * @notice This function will use mint  multiple NFTs /
            owner need to  mint  this NFTs by passing the required agrs as array.
        * @param _ids  tokenId array.
        * @param _tos reciver address array. 
        * @param _royality creater royality array. 
        * @param _newTokenURIs  token URI array. 
     */
    function mintAll(
        uint256[] memory _ids,
        address[] memory _tos,
        uint256[] memory _royality,
        string[] memory _newTokenURIs
    ) public onlyOwner {
        require(
            _ids.length == _tos.length,
            "tokenIDs and creators are not mismatched"
        );
        require(
            _ids.length == _newTokenURIs.length,
            "tokenIDs and tokenURI are not mismatched"
        );

        for (uint256 i = 0; i < _ids.length; i++) {
            require(
                _royality[i] <= maximumRoyality,
                "royality of creater is too high"
            );
            mint(_ids[i], _tos[i], _royality[i], _newTokenURIs[i]);
            royalities[_ids[i]] = _royality[i];
            creators[_ids[i]] = payable(_tos[i]);
            tokensPerCreator[_tos[i]].push(_ids[i]);
        }
    }

    /**
     * @dev mint `tokenId`.
     * The approval is cleared when the token is mint.
     *
     * Requirements:
     *
     * - `tokenId` must  not be exist.
     *
     * Emits a {Transfer} event from zero address.
     */
    function mint_(
        address to,
        uint256 tokenId,
        uint256 _royality
    ) internal {
        _safeMint(to, tokenId);
        royalities[tokenId] = _royality;
        creators[tokenId] = payable(msg.sender);
        tokensPerCreator[msg.sender].push(tokenId);
    }
}

